import logo from './logo.svg';
import './App.css';
import ContactList from './ContactList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Displaying contacts.
        </p>
      </header>
      <ContactList />
    </div>
  );
}

export default App;
